import React, { useEffect, useState } from "react";
import { Table, Card, Button, Modal, Form } from "react-bootstrap";
import { getFeedbacks, deleteFeedback, updateFeedback } from "../services/api";
import FeedbackRow from "./FeedbackRow";

export default function Dashboard() {
  const [feedbacks, setFeedbacks] = useState([]);
  const [loading, setLoading] = useState(true);
  const [showEdit, setShowEdit] = useState(false);
  const [editing, setEditing] = useState(null);

  const fetch = async () => {
    setLoading(true);
    try {
      const res = await getFeedbacks();
      setFeedbacks(res.data);
    } catch (err) {
      console.error(err);
    }
    setLoading(false);
  };

  useEffect(() => {
    fetch();
  }, []);

  const handleDelete = async (id) => {
    if (!window.confirm("Delete this feedback?")) return;
    try {
      await deleteFeedback(id);
      setFeedbacks(feedbacks.filter((f) => f._id !== id));
    } catch (err) {
      console.error(err);
    }
  };

  const openEdit = (fb) => {
    setEditing(fb);
    setShowEdit(true);
  };

  const closeEdit = () => {
    setEditing(null);
    setShowEdit(false);
  };

  const submitEdit = async (e) => {
    e.preventDefault();
    const form = e.target;

    const updatedData = {
      courseName: form.courseName.value,
      courseDuration: form.courseDuration.value,
      comments: form.comments.value,
      rating: Number(form.rating.value),
    };

    try {
      const res = await updateFeedback(editing._id, updatedData);
      setFeedbacks(feedbacks.map((f) => (f._id === editing._id ? res.data : f)));
      closeEdit();
    } catch (err) {
      console.error(err);
    }
  };

  return (
    <>
      <Card className="card-custom p-3">
        <Card.Body>
          <Card.Title>Feedback Dashboard</Card.Title>

          {loading ? (
            <p>Loading...</p>
          ) : (
            <Table responsive hover>
              <thead>
                <tr>
                  <th>Course ID</th>
                  <th>Course Name</th>
                  <th>Duration</th>
                  <th>Comments</th>
                  <th>Rating</th>
                  <th>Actions</th>
                </tr>
              </thead>
              <tbody>
                {feedbacks.length === 0 ? (
                  <tr>
                    <td colSpan="6" className="text-center">
                      No feedback found. Add new feedback.
                    </td>
                  </tr>
                ) : (
                  feedbacks.map((fb) => (
                    <FeedbackRow
                      key={fb._id}
                      feedback={fb}
                      onDelete={handleDelete}
                      onEdit={() => openEdit(fb)}
                    />
                  ))
                )}
              </tbody>
            </Table>
          )}
        </Card.Body>
      </Card>

      {/* Edit Modal */}
      <Modal show={showEdit} onHide={closeEdit}>
        <Form onSubmit={submitEdit}>
          <Modal.Header closeButton>
            <Modal.Title>Edit Feedback</Modal.Title>
          </Modal.Header>
          <Modal.Body>
            {editing && (
              <>
                <Form.Group className="mb-2">
                  <Form.Label>Course Name</Form.Label>
                  <Form.Control name="courseName" defaultValue={editing.courseName} required />
                </Form.Group>

                <Form.Group className="mb-2">
                  <Form.Label>Course Duration</Form.Label>
                  <Form.Control name="courseDuration" defaultValue={editing.courseDuration} />
                </Form.Group>

                <Form.Group className="mb-2">
                  <Form.Label>Comments</Form.Label>
                  <Form.Control name="comments" as="textarea" rows="3" defaultValue={editing.comments} />
                </Form.Group>

                <Form.Group>
                  <Form.Label>Rating</Form.Label>
                  <Form.Control type="number" name="rating" min="0" max="5" defaultValue={editing.rating} />
                </Form.Group>
              </>
            )}
          </Modal.Body>
          <Modal.Footer>
            <Button variant="secondary" onClick={closeEdit}>Cancel</Button>
            <Button type="submit" variant="primary">Update</Button>
          </Modal.Footer>
        </Form>
      </Modal>
    </>
  );
}
